import "bootstrap/dist/css/bootstrap.min.css";
import React, { useState } from "react";
import Slider from "react-slick";
import "slick-carousel/slick/slick-theme.css";
import "slick-carousel/slick/slick.css";
import Item from "../Item/Item";
import "./Home.css";

const Home = () => {
  const [product, setProduct] = useState("");
  const settings = {
    dots: true,
    className: 'cente',
    centerMode: true,
    infinite: true,
    centerPadding: "60px",
    slidesToShow: 2,
    speed: 500,
    autoplay: true,
    autoplaySpeed: 3000,
    arrows: true,
  };
  const data = [
    {
      id: 1,
    },
    {
      id: 2,
    },
    {
      id: 3,
    },
  ];
  console.log(product);
  return (
    <div>
      <div style={{ background: "yellow" }}>df</div>
      <div style={{ background: "#eee", width: "100%", height: "100%" }}>
        <Slider {...settings}>
          {data.map((ele) => (
            <Item item={ele} setProduct={setProduct} />
          ))}
        </Slider>
      </div>
    </div>
  );
};

export default Home;
